using ShineEngine;

/// <summary>
/// 掉落物品包绑定数据(generated by shine)
/// </summary>
public class FieldItemBagBindData:BaseData
{
	/// <summary>
	/// 数据类型ID
	/// </summary>
	public const int dataID=BaseDataType.FieldItemBagBind;
	
	/// <summary>
	/// 归属单位实例id
	/// </summary>
	public int instanceID;
	
	/// <summary>
	/// 物品组
	/// </summary>
	public SList<ItemData> items;
	
	/// <summary>
	/// 移除时间
	/// </summary>
	public long removeTime;
	
	public FieldItemBagBindData()
	{
		_dataID=BaseDataType.FieldItemBagBind;
	}
	
	/// <summary>
	/// 获取数据类名
	/// </summary>
	public override string getDataClassName()
	{
		return "FieldItemBagBindData";
	}
	
	/// <summary>
	/// 读取字节流(完整版)
	/// </summary>
	protected override void toReadBytesFull(BytesReadStream stream)
	{
		stream.startReadObj();
		
		this.instanceID=stream.readInt();
		
		int itemsLen=stream.readLen();
		if(this.items!=null)
		{
			this.items.clear();
			this.items.ensureCapacity(itemsLen);
		}
		else
		{
			this.items=new SList<ItemData>();
		}
		
		SList<ItemData> itemsT=this.items;
		for(int itemsI=itemsLen-1;itemsI>=0;--itemsI)
		{
			ItemData itemsV;
			BaseData itemsVT=stream.readDataFullNotNull();
			if(itemsVT!=null)
			{
				if(itemsVT is ItemData)
				{
					itemsV=(ItemData)itemsVT;
				}
				else
				{
					itemsV=new ItemData();
					if(!(itemsVT.GetType().IsAssignableFrom(typeof(ItemData))))
					{
						stream.throwTypeReadError(typeof(ItemData),itemsVT.GetType());
					}
					itemsV.shadowCopy(itemsVT);
				}
			}
			else
			{
				itemsV=null;
			}
			
			itemsT.add(itemsV);
		}
		
		this.removeTime=stream.readLong();
		
		stream.endReadObj();
	}
	
	/// <summary>
	/// 写入字节流(完整版)
	/// </summary>
	protected override void toWriteBytesFull(BytesWriteStream stream)
	{
		stream.startWriteObj();
		
		stream.writeInt(this.instanceID);
		
		if(this.items!=null)
		{
			stream.writeLen(this.items.size());
			if(!this.items.isEmpty())
			{
				ItemData[] itemsVValues=this.items.getValues();
				for(int itemsVI=0,itemsVLen=this.items.length();itemsVI<itemsVLen;++itemsVI)
				{
					ItemData itemsV=itemsVValues[itemsVI];
					if(itemsV!=null)
					{
						stream.writeDataFullNotNull(itemsV);
					}
					else
					{
						nullObjError("itemsV");
					}
					
				}
			}
		}
		else
		{
			nullObjError("items");
		}
		
		stream.writeLong(this.removeTime);
		
		stream.endWriteObj();
	}
	
	/// <summary>
	/// 读取字节流(简版)
	/// </summary>
	protected override void toReadBytesSimple(BytesReadStream stream)
	{
		this.instanceID=stream.readInt();
		
		int itemsLen=stream.readLen();
		if(this.items!=null)
		{
			this.items.clear();
			this.items.ensureCapacity(itemsLen);
		}
		else
		{
			this.items=new SList<ItemData>();
		}
		
		SList<ItemData> itemsT=this.items;
		for(int itemsI=itemsLen-1;itemsI>=0;--itemsI)
		{
			ItemData itemsV;
			itemsV=(ItemData)stream.readDataSimpleNotNull();
			
			itemsT.add(itemsV);
		}
		
		this.removeTime=stream.readLong();
		
	}
	
	/// <summary>
	/// 写入字节流(简版)
	/// </summary>
	protected override void toWriteBytesSimple(BytesWriteStream stream)
	{
		stream.writeInt(this.instanceID);
		
		if(this.items!=null)
		{
			stream.writeLen(this.items.size());
			if(!this.items.isEmpty())
			{
				ItemData[] itemsVValues=this.items.getValues();
				for(int itemsVI=0,itemsVLen=this.items.length();itemsVI<itemsVLen;++itemsVI)
				{
					ItemData itemsV=itemsVValues[itemsVI];
					if(itemsV!=null)
					{
						stream.writeDataSimpleNotNull(itemsV);
					}
					else
					{
						nullObjError("itemsV");
					}
					
				}
			}
		}
		else
		{
			nullObjError("items");
		}
		
		stream.writeLong(this.removeTime);
		
	}
	
	/// <summary>
	/// 复制(潜拷贝)
	/// </summary>
	protected override void toShadowCopy(BaseData data)
	{
		if(!(data is FieldItemBagBindData))
			return;
		
		FieldItemBagBindData mData=(FieldItemBagBindData)data;
		
		this.instanceID=mData.instanceID;
		this.items=mData.items;
		this.removeTime=mData.removeTime;
	}
	
	/// <summary>
	/// 复制(深拷贝)
	/// </summary>
	protected override void toCopy(BaseData data)
	{
		if(!(data is FieldItemBagBindData))
			return;
		
		FieldItemBagBindData mData=(FieldItemBagBindData)data;
		
		this.instanceID=mData.instanceID;
		
		if(mData.items!=null)
		{
			if(this.items!=null)
			{
				this.items.clear();
				this.items.ensureCapacity(mData.items.size());
			}
			else
			{
				this.items=new SList<ItemData>();
			}
			
			SList<ItemData> itemsT=this.items;
			if(!mData.items.isEmpty())
			{
				ItemData[] itemsVValues=mData.items.getValues();
				for(int itemsVI=0,itemsVLen=mData.items.length();itemsVI<itemsVLen;++itemsVI)
				{
					ItemData itemsV=itemsVValues[itemsVI];
					ItemData itemsU;
					if(itemsV!=null)
					{
						itemsU=(ItemData)itemsV.clone();
					}
					else
					{
						itemsU=null;
						nullObjError("itemsU");
					}
					
					itemsT.add(itemsU);
				}
			}
		}
		else
		{
			this.items=null;
			nullObjError("items");
		}
		
		this.removeTime=mData.removeTime;
		
	}
	
	/// <summary>
	/// 是否数据一致
	/// </summary>
	protected override bool toDataEquals(BaseData data)
	{
		FieldItemBagBindData mData=(FieldItemBagBindData)data;
		if(this.instanceID!=mData.instanceID)
			return false;
		
		if(mData.items!=null)
		{
			if(this.items==null)
				return false;
			if(this.items.size()!=mData.items.size())
				return false;
			SList<ItemData> itemsT=this.items;
			SList<ItemData> itemsR=mData.items;
			int itemsLen=itemsT.size();
			for(int itemsI=0;itemsI<itemsLen;++itemsI)
			{
				ItemData itemsU=itemsT.get(itemsI);
				ItemData itemsV=itemsR.get(itemsI);
				if(itemsV!=null)
				{
					if(itemsU==null)
						return false;
					if(!itemsU.dataEquals(itemsV))
						return false;
				}
				else
				{
					if(itemsU!=null)
						return false;
				}
				
			}
		}
		else
		{
			if(this.items!=null)
				return false;
		}
		
		if(this.removeTime!=mData.removeTime)
			return false;
		
		return true;
	}
	
	/// <summary>
	/// 转文本输出
	/// </summary>
	protected override void toWriteDataString(DataWriter writer)
	{
		writer.writeTabs();
		writer.sb.Append("instanceID");
		writer.sb.Append(':');
		writer.sb.Append(this.instanceID);
		
		writer.writeEnter();
		writer.writeTabs();
		writer.sb.Append("items");
		writer.sb.Append(':');
		writer.sb.Append("List<ItemData>");
		if(this.items!=null)
		{
			SList<ItemData> itemsT=this.items;
			int itemsLen=itemsT.size();
			writer.sb.Append('(');
			writer.sb.Append(itemsLen);
			writer.sb.Append(')');
			writer.writeEnter();
			writer.writeLeftBrace();
			for(int itemsI=0;itemsI<itemsLen;++itemsI)
			{
				ItemData itemsV=itemsT.get(itemsI);
				writer.writeTabs();
				writer.sb.Append(itemsI);
				writer.sb.Append(':');
				if(itemsV!=null)
				{
					itemsV.writeDataString(writer);
				}
				else
				{
					writer.sb.Append("ItemData=null");
				}
				
				writer.writeEnter();
			}
			writer.writeRightBrace();
		}
		else
		{
			writer.sb.Append("=null");
		}
		
		writer.writeEnter();
		writer.writeTabs();
		writer.sb.Append("removeTime");
		writer.sb.Append(':');
		writer.sb.Append(this.removeTime);
		
		writer.writeEnter();
	}
	
	/// <summary>
	/// 初始化初值
	/// </summary>
	public override void initDefault()
	{
		this.items=new SList<ItemData>();
	}
	
	/// <summary>
	/// 回池
	/// </summary>
	protected override void toRelease(DataPool pool)
	{
		this.instanceID=0;
		this.items=null;
		this.removeTime=0L;
	}
	
}
